import './enterpriseService.scss';

const EnterpriseService = (): JSX.Element => {
    return (
        <div id="enterpriseService" className="enterpriseService">
            <div className="enterpriseService__wrapperText">
                <div className="enterpriseService__wrapperText__title">
                    <span>Enterprise Software</span>
                </div>
            </div>
        </div>
    );
}

export default EnterpriseService;
